import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";
class About extends Component {
    render() {
        return (
            <div className='About'>
                <MDBContainer>
                    <MDBRow>
                        <MDBCol xl="5" lg="6">
                        <div class="about-image">
                            <img className="img-fluid" src="https://avatars3.githubusercontent.com/u/43238830?s=460&u=e2eaa8762c366a72f04534bcceab912574bab3b5&v=4" alt="" />
                        </div>
                        </MDBCol>
                        <MDBCol xl="7" lg="6">.col-lg-6</MDBCol>
                    </MDBRow>
                </MDBContainer>
            </div>

        );
    }
}

export default About;
